import { Col, Container, Row } from "react-bootstrap";

const About = () => {
    return (
        <div className="about">
            <Container>
                <div className="about-story">
                    <Row>
                        <Col></Col>
                    </Row>
                </div>
            </Container>
        </div>
    );
};

export default About;
